import { StyleSheet, Text, View } from "react-native";
import React from "react";

const FurnitureAdPage = () => {
  return (
    <View>
      <Text>furnitureAdPage</Text>
    </View>
  );
};

export default FurnitureAdPage;

const styles = StyleSheet.create({});
